ssibly_sensitive\":false,\"created_at\":\"2021-06-03T18:23:53.000Z\",\"context_annotations\":[{\"domain\":{\"id\":\"119\",\"name\":\"Holiday\",\"description\":\"Holidays like Christmas or Halloween\"},\"entity\":{\"id\":\"1275179649987784704\",\"name\":\"International Pride Day\"}}]},{\"lang\":\"en\",\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":14,\"quote_count\":0},\"author_id\":\"135522881\",\"text\":\"Happy author, happy agent. \\uD83C\\uDF08 https://t.co/LKeU1yVjgi\",\"source\":\"Twitter for iPhone\",\"id\":\"1400473989634478087\",\"attachments\":{\"media_keys\":[\"3_1400473980436418563\"]},\"conversation_id\":\"1400473989634478087\",\"entities\":{\"urls\":[{\"start\":29,\"end\":52,\"url\":\"https://t.co/LKeU1yVjgi\",\"expanded_url\":\"https://twitter.com/anwenhooson/status/1400473989634478087/photo/1\",\"display_url\":\"pic.twitter.com/LKeU1yVjgi\"}]},\"possibly_sensitive\":false,\"created_at\":\"2021-06-03T15:26:33.000Z\"},{\"lang\":\"en\",\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":66,\"quote_count\":3},\"author_id\":\"156265400\",\"text\":\"Happy pub day to @MillyAbraham &amp; each &amp; every contributor to the NECESSARY and VITAL anthology We Can Do Better Than This @vintagebooks \\nHow can we create a better world for LGBTQ+ people? 35 extraordinary voices share stories and visions for the future https://t.co/DGPJSwGycO https://t.co/wuqMqq4VWf\",\"source\":\"Twitter Web App\",\"id\":\"1400426613548929035\",\"entities\":{\"mentions\":[{\"start\":17,\"end\":30,\"username\":\"MillyAbraham\"},{\"start\":130,\"end\":143,\"username\":\"vintagebooks\"}],\"urls\":[{\"start\":262,\"end\":285,\"url\":\"https://t.co/DGPJSwGycO\",\"expanded_url\":\"https://bit.ly/3g4ThSn\",\"display_url\":\"bit.ly/3g4ThSn\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1400426620415057924/ZfjkOCtK?format=jpg&name=orig\",\"width\":309,\"height\":500},{\"url\":\"https://pbs.twimg.com/news_img/1400426620415057924/ZfjkOCtK?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"We Can Do Better Than This ed. by Amelia Abraham | Gay's The Word\",\"description\":\"How can we create a better world for LGBTQ+ people? 35 extraordinary voices share their stories and visions for the future.We talk about achieving 'LGBTQ+ equality', but around the world, LGBTQ+ people are still suffering discrimination and extreme violence. How do we solve this urgent problem, allowing queer people everywhere the opportunity to thrive?In We Can Do Better Than This, 35 voices explore this question. Through deeply moving stories and provocative new arguments on safety and visibility, dating and gender, care and community, they map new global frontiers in the fight for LGBTQ+ rights.Pabllo Vittar pleads for the end of hate murders, Olly Alexander champions inclusive sex education in schools, and Beth Ditto calls for a revolution in representation. Elsewhere, Mykki Blanco sets out a vision to end HIV stigma, Owen Jones demands improved LGBTQ+ mental health services, and Travis Alabanza imagines a world without gender policing.Moving from the UK and USA to Russia, Banglade\",\"unwound_url\":\"https://www.gaystheword.co.uk/product-page/we-can-do-better-than-this-ed-by-amelia-abraham\"},{\"start\":286,\"end\":309,\"url\":\"https://t.co/wuqMqq4VWf\",\"expanded_url\":\"https://twitter.com/gaystheword/status/1400426613548929035/photo/1\",\"display_url\":\"pic.twitter.com/wuqMqq4VWf\"}]},\"attachments\":{\"media_keys\":[\"3_1400426218512687107\"]},\"conversation_id\":\"1400426613548929035\",\"possibly_sensitive\":false,\"created_at\":\"2021-06-03T12:18:17.000Z\"},{\"lang\":\"en\",\"public_metrics\":{\"retweet_count\":3,\"reply_count\":9,\"like_count\":28,\"quote_count\":0},\"author_id\":\"1342157224328769539\",\"entities\":{\"annotations\":[{\"start\":45,\"end\":51,\"probability\":0.336,\"type\":\"Person\",\"normalized_text\":\"Richard\"}],\"mentions\":[{\"start\":53,\"end\":64,\"username\":